import * as React from "react";
import {Pokemon} from "../model/Pokemon";

interface IProps {
    pokemon: Pokemon
}

export function EntryBox(props: IProps) {
    const pokemon: Pokemon = props.pokemon

    return(
        <div className="box">
            Id: {pokemon.id}<br/>
            Name: {pokemon.name}<br/>
        </div>
    )
}
